import React from "react";
import TestCard from "../../components/TestCard";
import searchIcon from "../../GAssets/search_big.png";
import styles from "../styles/gallery.module.scss";

const Gallery = (props: any) => {
  return (
    <div className="Gallery">
      <h1>Test gallery</h1>
      <div className="searchAndFilter">
        {/* //* Search Bar */}
        <div className="searchContainer">
          <input type="search" name="testSearch" className="testSearch" />
          <img src={searchIcon} alt="Looking glass icon" />
        </div>
        {/* //* Test type filter */}
        <select name="testTypeSelector" className="testSelecter">
          <option value="">Type1</option>
          <option value="">Type2</option>
          <option value="">Type3</option>
          <option value="">Type4</option>
          <option value="">Type5</option>
        </select>
      </div>
      {/* //* Test Gallery */}
      <div className="tCardContainer">
        <TestCard />
        <TestCard />
        <TestCard />
        <TestCard />
        <TestCard />
        <TestCard />
        <TestCard />
      </div>
    </div>
  );
};

export default Gallery;
